import { backendAPI } from '../../api';
export class ManageUsersServiceImplementation {
  async getAll() {
    const users = await backendAPI.get('admin/users');
    return users.data;
  }

  async create(internalUserDTO) {
    const newUser = await backendAPI.post('admin/users', internalUserDTO);
    return newUser.data;
  }

  async update(userID, internalUserDTO) {
    const updatedUser = await backendAPI.patch(`admin/users/${userID}`, internalUserDTO);
    return updatedUser.data;
  }

  async delete(userID) {
    await backendAPI.delete(`admin/users/${userID}`);
  }

}
